import React from 'react';
import './Card.css';
import { useLayout } from '../variables'; // adjust the path as necessary



const Card = () => {
  const { setCurrentLayout } = useLayout();

  const handleClick = (name) => () => {
    setCurrentLayout(name);
    console.log("current_layout updated to overview_layout");
  };

  return (
    <div className="card">
      <div className="card-header">
        <img src="https://avatars.githubusercontent.com/u/151031767?s=64&v=4"></img>
        <h1>Welcome to Skynet.</h1>
      </div>
      <div className="card-buttons">
        <button className="card-button" onClick={handleClick("overview_layout")} >Overview</button>
        <button className="card-button" >Alfa</button>
        <button className="card-button" >Beta</button>
      </div>
    </div>
  );
};

export default Card;
